import React from 'react';

import ThemeContext from '../../context/theme';
import { Section, Card, Center } from '../Globals';

import { newGames as layout } from '../../config/layout';

class NewGames extends React.Component {
  static contextType = ThemeContext;

  render() {
    return (
      <>
        <h3>New Games</h3>

        <div style={{ overflow: 'scroll' }}>
          <div>
            <Section {...layout}>
              <Section {...layout.items}>
                <Center>
                  <Card
                    style={{
                      height: '100px',
                      width: '100px',
                      borderRadius: '50%',
                      margin: '10px'
                    }}
                  >
                    1
                  </Card>
                </Center>
              </Section>
              <Section {...layout.items}>
                <Card
                  style={{
                    height: '100px',
                    width: '100px',
                    borderRadius: '50%',
                    margin: '10px'
                  }}
                >
                  <Center>2</Center>
                </Card>
              </Section>
              <Section {...layout.items}>
                <Card
                  style={{
                    height: '100px',
                    width: '100px',
                    borderRadius: '50%',
                    margin: '10px'
                  }}
                >
                  <Center></Center>3
                </Card>
              </Section>
              <Section {...layout.items}>
                <Card
                  style={{
                    height: '100px',
                    width: '100px',
                    borderRadius: '50%',
                    margin: '10px'
                  }}
                >
                  4
                </Card>
              </Section>
              <Section {...layout.items}>
                <Card
                  style={{
                    height: '100px',
                    width: '100px',
                    borderRadius: '50%',
                    margin: '10px'
                  }}
                >
                  5
                </Card>
              </Section>
              <Section {...layout.items}>
                <Card
                  style={{
                    height: '100px',
                    width: '100px',
                    borderRadius: '50%',
                    margin: '10px'
                  }}
                >
                  6
                </Card>
              </Section>
              <Section {...layout.items}>
                <Card
                  style={{
                    height: '100px',
                    width: '100px',
                    borderRadius: '50%',
                    margin: '10px'
                  }}
                >
                  7
                </Card>
              </Section>
              <Section {...layout.items}>
                <Card
                  style={{
                    height: '100px',
                    width: '100px',
                    borderRadius: '50%',
                    margin: '10px'
                  }}
                >
                  8
                </Card>
              </Section>
            </Section>
          </div>
        </div>
      </>
    );
  }
}

export default NewGames;
